import React from 'react';
import { Box } from '@mui/material';
import {
    BrowserRouter as Router,
    useParams
} from "react-router-dom";
const Shop = () => {
    const id = useParams()
    return (
      <div>
            <p>id ----- {id}</p>
      </div>
  )
};

export default Shop;
